class Solution:
    def findSubstring(self, s, words):
        """
        :type s: str
        :type words: List[str]
        :rtype: List[int]
        """
        from collections import defaultdict
        if len(words) == 0 or len(s) == 0:
            return []
        word_count = defaultdict(int)
        ans = []
        for w in words:
            word_count[w] += 1
        len_word = len(words[0])
        sub_len = len(words[0]) * len(words)
        i = 0
        while i + sub_len <= len(s):
            j = i
            _word_count = word_count.copy()
            while j - i <= sub_len and _word_count[s[j:j+len_word]] > 0:
                _word_count[s[j:j+len_word]] -= 1
                j += len_word
            if j - i >= sub_len:
                ans.append(i)
            i += 1
        return ans

